import styled from "styled-components";

export const FooterDiv = styled.div`
  display: flex;
  flex-wrap: wrap;
  background-color: #03233e;
  height: 326px;
  justify-content: space-evenly;
`;

export const FooterElement = styled.div`
  display: flex;
  flex-direction: column;
  color: white;
  & p {
    margin: 2px;
    font-size: 0.9em;
  }
  & h2 {
    font-size: 20px;
    FO
  }
`;

export const FooterLogo = styled.div`
  width: 220px;
  height: 95px;
  margin-top: 30px;

  & h3 {
    border-radius: 5px;
    background-color: white;
    color: blue;
    font-size: 1em;
    font-weight: bold;
    text-align: center;
    border-radius: 5px;
    padding: 8px 16px;
    margin: 33px 10px 0 0px;
  }
  & img {
    width: 130px;
    margin: 10px 90px;
  }
`;
